CREATE TABLE `pipeline_logger` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `uuid` varchar(32) DEFAULT NULL COMMENT '唯一标示做关联',
  `pipeline_uuid` varchar(32) NOT NULL COMMENT '流水线uuid',
  `content` longtext COMMENT '存储数据正文',
  `execute_start_time` datetime NOT NULL COMMENT '执行时间',
  `execute_end_time` datetime DEFAULT NULL COMMENT '结束时间',
  `final_status` varchar(20) DEFAULT NULL COMMENT '最终执行状态',
  `creator` varchar(64) DEFAULT NULL COMMENT '创建人',
  `modifier` varchar(64) DEFAULT NULL COMMENT '修改人',
  `gmt_create` datetime NOT NULL COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL COMMENT '修改时间',
  `deleted` char(1) NOT NULL DEFAULT '0' COMMENT '逻辑删除',
  `graph_content` text COMMENT '流水线快照',
  `target_way` varchar(20) DEFAULT NULL COMMENT '触发方式',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=92 DEFAULT CHARSET=utf8mb4 COMMENT='流水线执行记录';
